import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <ul>
      <Link>
        <li>Home</li>
      </Link>
      <li>Rappers</li>
      <li>Log In</li>
    </ul>
  );
};

export default Navbar;
